import logo from './logo.svg';
import './App.css';
import Home from './Components/Home';
import inicioIMG from "./assets/img/icons8-star-trek-espacio-profundo-nueve-96.png";
import sobreMeIMG from "./assets/img/icons8-astronauta-60.png";
import proyectosIMG from "./assets/img/icons8-cohete.png";
import miAporteIMG from "./assets/img/icons8-estrellas-96.png";
function App() {
  return (
    <div id='body' className="App">
      <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
        <nav>
          <div><a><img src={inicioIMG}></img><h3>Inicio</h3></a></div>
          {/* <div><a><img src={sobreMeIMG}></img><h3>Sobre mi</h3></a></div> */}
          <div><a><Link to="/"></Link></a></div>
          <div><a><img src={proyectosIMG}></img><h3>Proyectos</h3></a></div>
          <div><a><img src={miAporteIMG}></img><h3>Mi Aporte</h3></a></div>
        </nav>
        <Home></Home>
    </div>
  );
}

export default App;
